data.value:
Order – порядковый номер секции, 
            исчисляя от бункера машины; 
D, L, H – внутренний диаметр корпуса,
             длина секции и зазор между червяком и корпусом; 
k_integr – число циклов интегрирования вдоль секции;

Var_T – способ задания температуры корпуса (1 или 2); 
L – длина секции; 
Delta – толщина теплопередающей стенки; 
T – температура корпуса при Var_T=1. 

Для теплоносителя (при  Var_T=2): 
Al – коэффициент теплоотдачи;
A, Lam – температуро- и теплопроводность; 
Q – объёмный расход.

   2000 – насыщенный пар (a, Lam, Q задать условно);
     10 – воздух при естественной конвекции;  
     20 – поток воздуха;
    350 – вода без принудительной конвекции, 
             включая при её высокой температуре; 
    700 – поток воды (a=14×10-8 м^2/с; Lam=0.6 Вт/(м·К)

Var_T – способ задания температуры корпуса (1 или 2); 
L – длина секции; 
Delta – толщина теплопередающей стенки; 
T – температура корпуса при Var_T=1. 

Для теплоносителя (при  Var_T=2): 
Al – коэффициент теплоотдачи;
A, Lam – температуро- и теплопроводность; 
Q – объёмный расход.

   2000 – насыщенный пар (a, Lam, Q задать условно);
     10 – воздух при естественной конвекции;  
     20 – поток воздуха;
    350 – вода без принудительной конвекции, 
             включая при её высокой температуре; 
    700 – поток воды (a=14×10-8 м^2/с; Lam=0.6 Вт/(м·К)

Order – порядковый номер секции, 
            исчисляя от бункера машины; 
i – число заходов нарезки; 
R or L – правая или левая нарезка; 
D, L, H – внутренний диаметр корпуса, 
             длина секции и глубина канала; 
Step, e, delta – шаг нарезки, толщина гребня нарезки и 
                       радиальный зазор;
Start – в начале секции;

