Start – в начале секции;

PRIZNAK – вид сечения (1 – круг, 2 – кольцо); 
Order – порядковый номер секции; 
D – наружный диаметр канала;  
L – длина участка канала; 
D_VH – внутренний диаметр канала;
T_st – температура наружной стенки канала; 
T_VH – температура дорна; 
k_integr – число циклов интегрирования в пределах 
               секции.
start или  st– в начале секции;
final или fn – в конце секции.

